export default class extends React.Component{
    render(){
        return(
            <div className='estilo'>
                <ul className='nav-tabs__list'>
                    <li className='nav-tabs__item is-active'>
                        <a className='nav-tabs__link'>Hombre</a>
                    </li>
                    <li className='nav-tabs__item'>
                        <a className='nav-tabs__link'>Mujer</a>
                    </li>
                </ul>
                <style jsx>
                    {`
                        .estilo{
                            width: 100%;
                            text-align: center;
                            margin-top: 3%;
                        }
                        .nav-tabs__list {
                            border: 3px solid black;
                            display: inline-block;
                             }

                        .nav-tabs__item {
                            float: left;
                        }

                        .nav-tabs__link {

                            font-size: .9375rem;
                            color: black !important;
                            display: block;
                            line-height: 1;
                            min-width: 9.25rem;
                            padding: .625rem 0 .4375rem;
                            text-align: center;
                            text-transform: uppercase;
                        }

                        .is-active  .nav-tabs__link {
                            background: black !important;
                            color:  #ffffff !important;
                        }

                        .nav-tabs__list .nav-tabs__item a {
                            color: black;
                            background: #ffffff;
                            outline: medium none;
                            overflow: hidden;
                            text-decoration: none;
                        }

                        .nav-tabs__list li {
                            list-style-position: inside;
                            list-style: none;
                        }

                        .nav-tabs__link {
                            font-size: .9375rem;
                            color: black !important;
                            display: block;
                            line-height: 1;
                            min-width: 9.25rem;
                            padding: .625rem 0 .4375rem;
                            text-align: center;
                            text-transform: uppercase;
                        }
                    `}
                </style>
            </div>
        );
    }
}
